
exports.seed = function(knex, Promise) {
  // Deletes ALL existing entries
  return knex.raw('DELETE FROM gallery; ALTER SEQUENCE gallery_id_seq RESTART WITH 4;')
    .then(function () {
      // Inserts seed entries
      return knex('gallery').insert([
        {id: 1, imageURL:"data:image/jpeg;base64,",
        users_id: 1
        },
        {id: 2, imageURL:"data:image/jpeg;base64,",
        users_id: 1
        },
        {
          id: 3, imageURL:"data:image/jpeg;base64,",
          users_id: 2
        },
      ]);
    });
};
